  constructor () {

    super();

    this.state = {

    string: 'Hello Roland'

    }

    }
   render() {
return (
        <div className="App">
          <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <p>
              Edit <code>src/App.js</code> and save to reload.
            </p>
           <button>{this.state.string}</button>
          </header>
        </div>
)
   }
}

export default App;
